function LongJump(n) {
    var xaw = (getYaw() % 360) * Math.PI / 180;
    xv = -Math.sin(xaw) * n;
    zv = Math.cos(xaw) * n;
    setVelX(getPlayerEnt(), xv);
    setVelY(getPlayerEnt(), 0.5);
    setVelZ(getPlayerEnt(), zv);
}

function setPlayerGameMode(mode){
	Level.setGameMode(mode)
}

function SneakAttack(target){
	var xaw = (getYaw() % 360) * Math.PI / 180, n = -2;
	xv = -Math.sin(xaw) * n;
	zv = Math.cos(xaw) * n;
	Entity.setPosition(getPlayerEnt(), Entity.getX(target) + xv, Entity.getY(), Entity.getZ() + zv)
}

function Teleport(target){
	Entity.setPosition(getPlayerEnt(), Entity.getX(target), Entity.getY(), Entity.getZ())
}

function setSelectionItem(item, num, data){
	Player.setInventorySlot(Player.getSelectedSlotId(), item, num, data);
}

function EnchantAll(){
		var All = [Enchantment.PROTECTION, Enchantment.FIRE_PROTECTION, Enchantment.FEATHER_FALLING, Enchantment.BLAST_PROTECTION, Enchantment.PROJECTILE_PROTECTION, Enchantment.THORNS, Enchantment.RESPIRATION, Enchantment.AQUA_AFFINITY, Enchantment.DEPTH_STRIDER, Enchantment.SHARPNESS, Enchantment.SMITE, Enchantment.BANE_OF_ARTHROPODS, Enchantment.KNOCKBACK, Enchantment.FIRE_ASPECT, Enchantment.LOOTING, Enchantment.EFFICIENCY, Enchantment.SILK_TOUCH, Enchantment.UNBREAKING, Enchantment.FORTUNE, Enchantment.POWER, Enchantment.PUNCH, Enchantment.FLAME, Enchantment.INFINITY, Enchantment.LUCK_OF_THE_SEA, Enchantment.LURE];
		for(var i = 0 ; i < All.length ; i++){
			Item.setEnchantType(getCarriedItem(), All[i], 1);
			Player.enchant(Player.getSelectedSlotId(),All[i],32767)
		}
}

